function handleMouseClicks() {
    const button = 0;
    const isPressed = Input.isMouseButtonPressed(0);
    if (isPressed) {
        if (state.mouseButtonStates[0] !== 'held' && state.mouseButtonStates[0] !== 'pressed') state.mouseButtonStates[button] = 'pressed';
    } else if (state.mouseButtonStates[0] === 'held' || state.mouseButtonStates[0] === 'pressed') state.mouseButtonStates[button] = 'released';
    if (state.mouseButtonStates[0] === 'pressed') {
        const coords = Input.getMousePos();
