                const currentPosition = player.position;
                log(`Current position: ${currentPosition.x}, ${currentPosition.y}`);
                const path = Pathfinding.findPath(Math.round(currentPosition.x), Math.round(currentPosition.y), Math.round(coords.x), Math.round(coords.y), 0);
                log(`Path length: ${path.length}`);
                if (path.length > 0) {
                    player.path = path;
                    player.currentPathIndex = 0;
                    log(`Path length: ${path.length}`);
                } else log("No path found to the destination.");
